	add("slat", "{\"term\":\"slat\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"Old french (842-ca. 1400) {{m|fro|esclat}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A thin, narrow strip or bar of wood or metal\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"slats\u0027\u0027 of a window blind\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A movable control surface at the leading edge of a wing that when moved, changes the chord line of the airfoil, affecting the angle of attack. Employed in conjunction with flaps to allow for a lower stall speed in the landing attitude, facilitating slow flight\", \"priority\":3}]}, \"synonyms\":{}}");

	add("slav", "{\"term\":\"slav\", \"etymology\":{\"influencers\":[], \"languages\":[\"Old Church Slavonic\", \"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) \u0027sclave\u0027 from \u0027sclavus\u0027 or \u0027sclavus\u0027 from \u0027σκλάβος\u0027 from earlier \u0027σκλαβῆνος\u0027 plural \u0027σκλαβῆνοι\u0027 from Proto-slavic {{m|sla-pro|*slověnji}}, {{m|sla-pro|*slověne||those who speak meaningfully}}, singular {{m|sla-pro|*slověninъ}}. Compare Old church slavonic \u0027словѣни\u0027 \u0027словѣнє\u0027 (tr\u003dslověne) Old East Slavic \u0027словѣне\u0027 (tr\u003dslověne) Commonly thought to derive from Proto-Slavic {{m|sla-pro|*slovo||word}}, thus meaning \u0026quot;those who speak meaningfully\u0026quot; and contrasting with {{m|sla-pro|*němьcь||foreigner|lit\u003ddumb/mute person}}. However, that word is an s-stem and thus the inflectional stem of that word is {{m|sla-pro||*sloves-}}, so it cannot be the direct origin as it would lead to an expected form {{m|sla-pro||*slovesěni}} (compare Russian \u0027слове́сность\u0027 . Thus the most likely origin is the verb {{m|sla-pro|*sluti||to be known}}.\u0026lt;ref name\u003dmaher\u0026gt;John P. Maher (Chicago), \u0026quot;The Etymology of Common Slavic \u0027slověne\u0027 \u0027Slavs\u0027\u0026quot;, (in:) Balkansko Ezikoznanie XIV, 2, p. 31–36, Sofia 1970\u0026lt;/ref\u0026gt; Both words ultimately derive from Proto-indo-european {{m|ine-pro|*ḱlew-||fame}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"thumb|People from these countries are usually considered Slavs\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A member of any of the peoples from Eastern Europe who speak the Slavic languages\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The Slavonian grebe\", \"priority\":3}]}, \"synonyms\":{}}");

	add("slacker", "{\"term\":\"slacker\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|slack|er|lang\u003den}}; compare especially \u0027slack off\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who procrastinates or is lazy\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A person lacking a sense of direction in life; an underachiever\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A person who seeks to avoid military service\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1918\u0027\u0027 September 10, \u0027New York Times\u0027, [http://query.nytimes.com/gst/abstract.html?res\u003d9401E6D81439E13ABC4852DFBF668383609EDE \u0026quot;Take Slackers into Army\u0026quot\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"S]everal hundred prisoners captured in North Jersey \u0027\u0027slacker\u0027\u0027 raids last week and sent to this camp are being Inducted into military service today\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1943\u0027\u0027 September 29, \u0027New York Times\u0027, [http://select.nytimes.com/gst/abstract.html?res\u003dF00611FB3F59147B93CBAB1782D85F478485F9\u0026amp; \u0026quot;Wheeler assails Bureau \u0027Slackers\u0027\u0026quot\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Senator Burton K. Wheeler opened his fight in the Senate today..., raising the cry of \u0026quot;\u0027\u0027slackers\u0027\u0027\u0026quot; against deferred workers in Government establishments and industry\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"very rare) A user of the Slackware Linux operating system\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"1996\u0027\u0027 August 15, stephen benson, [http://groups.google.com/group/comp.os.linux.setup/msg/f7b4421c6c994778 \u0026quot;Re: How broken is Infomagic\u0027s Redhat linux?\u0026quot;], \u0026lt;tt\u0026gt;comp.os.linux.setup\u0026lt;/tt\u0026gt;, \u0027Usenet\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"I\u0027m a \u0027\u0027slacker\u0027\u0027 from way back bt\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027 January 15, Josh, [http://groups.google.com/group/comp.os.linux/msg/5e4db28776757155 \u0026quot;Re: slackware installation issue\u0026quot;], \u0026lt;tt\u0026gt;comp.os.linux\u0026lt;/tt\u0026gt;, \u0027Usenet\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Hope you become a happy \u0027\u0027slacker\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027 May 16, Dan C, [http://groups.google.com/group/alt.os.linux/msg/ca583dc3a3fcba66 \u0026quot;Re: Distro Poll, what do you use?\u0026quot;], \u0026lt;tt\u0026gt;alt.os.linux\u0026lt;/tt\u0026gt;, \u0027Usenet\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Any real \u0027\u0027Slacker\u0027\u0027 would know better than to top-post, AND post a bunch of HTML-crap to boot. You\u0027re not worthy\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"A member of a certain 1990s subculture associated with Generation X\", \"priority\":15}]}, \"synonyms\":{}}");

