	add("slash", "{\"term\":\"slash\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A swift cut with a blade, particularly with fighting weapons as a sword, saber, knife etc\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A swift striking movement\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The symbol \u0027\u0027/\u0027\u0027, also called diagonal, separatrix, shilling mark, solidus, stroke, virgule. Also sometimes known as a forward slash, particularly in computing\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A pee, a trip to the toilet to urinat\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Excuse me, I need to take a \u0027\u0027slash\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"slash Slash fiction\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, Katherine Arcement, \u0026quot;Diary\u0026quot;, \u0027London Review of Books\u0027, vol. 35, no. 5\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Comments merely allow readers to proclaim themselves mortally offended by the content of a story, despite having been warned in large block letters of INCEST or \u0027\u0027SLASH\u0027\u0027 (any kind of sex between two men or two women: the term originated with the Kirk/Spock pairing – it described the literal slash between their names\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The female genitali\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A quick and hard lateral strike with a hockey stick, usually across the arms or legs\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"swampy or wet lands overgrown with bushe\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Coarse, fine woody debris generated during logging operations or through wind, snow, etc\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Slash\u0027\u0027 generated during logging operations may increase fire hazard\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"An opening or gap in a forest made by wind, fire, or other destructive agency\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"Henry Van Dyk\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"We passed over the shoulder of a ridge and around the edge of a fire \u0027\u0027slash\u0027\u0027, and then we had the mountain fairly before us\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"An opening in an item of clothing to show skin or a contrasting fabric underneath\", \"priority\":17}]}, \"synonyms\":{}}");

	add("slate", "{\"term\":\"slate\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027esclate\u0027 from \u0027esclat\u0027 (French \u0027éclat\u0027 .\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A fine-grained homogeneous sedimentary rock composed of clay or volcanic ash which has been metamorphosed so that it cleaves easily into thin layers\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The bluish-grey colour of most slate\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A sheet of slate for writing on with chalk or with a thin rod of slate (a slate pencil) formerly commonly used by younger children for writing practice in schools\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A roofing-tile made of slate\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A record of money owed\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Put it on my \u0027\u0027slate\u0027\u0027 – I’ll pay you next week\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A list of affiliated candidates for an election\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Roy Disney led the alternative \u0027\u0027slate\u0027\u0027 of directors for the stockholder vote\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"An artificial material resembling slate and used for the same purposes\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A thin plate of any material; a flake\", \"priority\":10}]}, \"synonyms\":{}}");

